import { View, Text, Image, Pressable, TouchableOpacity } from "react-native";
import React from "react";
import { SafeAreaView } from "react-native-safe-area-context";
import { Ionicons, FontAwesome5 } from "@expo/vector-icons";
import Usdttrc from "./Usdttrc";

const Deposit = ({ navigation }) => {
  return (
    <SafeAreaView>
      <View
        style={{
          flexDirection: "row",
          justifyContent: "space-between",
          alignItems: "center",
          paddingHorizontal: "3%",
        }}
      >
        <View
          style={{
            flexDirection: "row",
            alignItems: "center",
          }}
        >
          <Ionicons
            name="arrow-back-outline"
            size={30}
            color="black"
            onPress={() => navigation.goBack("")}
          />
          <Text
            style={{
              fontSize: 20,
              fontWeight: "bold",
            }}
          >
            Deposit
          </Text>
        </View>

        <TouchableOpacity
          style={{
            textAlign: "center",
            paddingVertical: 2,
            paddingHorizontal: 6,
            borderRadius: 4,
            backgroundColor: "#2E2E3D",
          }}
          onPress={() => navigation.navigate("Deposithistory")}
        >
          <Text style={{ color: "white", fontWeight: "bold" }}>
            Transactions
          </Text>
        </TouchableOpacity>
      </View>
      <View>
        <Text
          style={{
            padding: 10,
            marginLeft: 5,
            marginTop: 40,
            fontSize: 17,
            color: "gray",
          }}
        >
          Network
        </Text>
      </View>

      <Pressable
        style={{
          flexDirection: "row",
          width: "95%",
          alignSelf: "center",
          marginTop: 3,
          marginBottom: 10,
          borderRadius: 5,
          padding: 20,
          backgroundColor: "black",
          borderColor: "#D3D3D3",
          borderStyle: "solid",
          borderWidth: 0.5,
          alignItems: "center",
        }}
        onPress={() => navigation.navigate("Usdterc")}
      >
        <Image
          source={require("../assets/USDT.png")}
          style={{
            alignItems: "center",
            height: 30,
            width: 30,
            marginRight: 10,
          }}
        />
        <Text
          style={{
            fontSize: 20,
            color: "white",
          }}
        >
          USDT-ERC
        </Text>
        <View
          style={{
            // marginLeft: 200,
            marginLeft: "auto",
          }}
        >
          <Ionicons name="md-arrow-forward-circle" size={24} color="gray" />
        </View>
      </Pressable>
      <TouchableOpacity
        style={{
          flexDirection: "row",
          width: "95%",
          alignSelf: "center",
          marginTop: 3,
          marginBottom: 10,
          borderRadius: 5,
          padding: 20,
          backgroundColor: "black",
          borderColor: "#D3D3D3",
          borderStyle: "solid",
          borderWidth: 0.5,
          alignItems: "center",
        }}
        onPress={() => navigation.navigate("Usdttrc")}
      >
        <Image
          source={require("../assets/USDT.png")}
          style={{
            alignItems: "center",
            height: 30,
            width: 30,
            marginRight: 10,
          }}
        />
        <Text
          style={{
            justifyContent: "center",
            fontSize: 20,
            color: "white",
          }}
        >
          USDT-TRC
        </Text>
        <View
          style={{
            // marginLeft: 200,
            marginLeft: "auto",
          }}
        >
          <Ionicons name="md-arrow-forward-circle" size={24} color="gray" />
        </View>
      </TouchableOpacity>
      <TouchableOpacity
        style={{
          flexDirection: "row",
          width: "95%",
          alignSelf: "center",
          marginTop: 3,
          marginBottom: 10,
          borderRadius: 5,
          padding: 20,
          backgroundColor: "black",
          borderColor: "#D3D3D3",
          borderStyle: "solid",
          borderWidth: 0.5,
          alignItems: "center",
        }}
        onPress={() => navigation.navigate("Btc")}
      >
        <FontAwesome5 name="bitcoin" size={24} color="orange" />
        <Text
          style={{
            marginLeft: 10,
            fontSize: 20,
            color: "white",
          }}
        >
          BTC
        </Text>
        <View
          style={{
            // marginLeft: 270,
            marginLeft: "auto",
          }}
        >
          <Ionicons name="md-arrow-forward-circle" size={24} color="gray" />
        </View>
      </TouchableOpacity>
      <TouchableOpacity
        style={{
          flexDirection: "row",
          width: "95%",
          alignSelf: "center",
          marginTop: 3,
          marginBottom: 10,
          borderRadius: 5,
          padding: 20,
          backgroundColor: "black",
          borderColor: "#D3D3D3",
          borderStyle: "solid",
          borderWidth: 0.5,
        }}
        onPress={() => navigation.navigate("Eth")}
      >
        <FontAwesome5
          name="ethereum"
          size={24}
          color="gray"
          style={{
            marginLeft: 3,
          }}
        />
        <Text
          style={{
            marginLeft: 15,
            fontSize: 20,
            color: "white",
          }}
        >
          ETH
        </Text>
        <View
          style={{
            // marginLeft: 270,
            marginLeft: "auto",
          }}
        >
          <Ionicons name="md-arrow-forward-circle" size={24} color="gray" />
        </View>
      </TouchableOpacity>
    </SafeAreaView>
  );
};

export default Deposit;
